import React from "react";

export default function Dione(props) {
    const {story} = props;
    return (
        <div className="section">
            <div className="section--text">
                {story.slice(0,3)}
            </div>
            <img src={require("../photos/Dione/Dione1.png")} className="section--photo"/>
        </div>
    )
}
